		"text": "왜 ‘82년생 김지영’에게만 보편의 서사를 요구하는가\nhttps://t.co/bvkK2PL6f4\n\n〈82년생 김지영〉이 ‘대졸 중산층 여성의 삶만을 다룬다’는 비판이 있다.\n\n맞는 말이다. 그런데 드라마 〈미생〉이 비정규직 문제를 다룰 때, ‘그래봤자 저건 공부 좀 한 사무직들의 이야기’라는 사람은 없었다. https://t.co/vH6rNLy22P"
