		"text": "카카오 통합계정 묶은 순간부터 다음이고 멜론이고 로그인을 카카오 아이디로만 하라는데 매번 리캡챠 \"로봇이 아닙니다\" 눌러서 로그인 해야됨. 비밀번호 자동입력 서비스 쓰는데 이것 때문에 너무 불편함. 연동 푸는 방법? 없음. 탈퇴하는 것 뿐임. https://t.co/KGd1IOz9j8"
